create or replace TEMP view aggView7767416530290210365 as select v1, v24, COUNT(*) as annot from semiDown3008285826331433539 group by v1,v24;
create or replace TEMP view aggJoin3880391773394959410 as select v6, v24, annot from semiUp3249832667562893777 join aggView7767416530290210365 using(v1);
